var title_f11_3_11321="Organoaxial gastric volvulus";
var content_f11_3_11321=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RADIOL%2F83732%7ERADIOL%2F83734&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RADIOL%2F83732%7ERADIOL%2F83734&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 620px\">",
"   <div class=\"ttl\">",
"    Organoaxial gastric volvulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 600px; height: 386px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The plain radiograph of the abdomen (A) shows a large central gas bubble in the thoracic cavity reminiscent of a large hiatal hernia (between white arrows). A barium study (B)&nbsp;shows the greater curvature of the stomach (red arrow) superior to the lesser curvature (blue arrow). These findings are characteristic of an organoaxial volvulus.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 617px\">",
"   <div class=\"ttl\">",
"    Mesenteroaxial gastric volvulus on upper GI study and computed tomography",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 597px; height: 250px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This 64-year-old male presented with medication-resistant gastroesophageal reflux disease. Mesenteroaxial gastric volvulus is noted on a barium swallow fluoroscopic examination (A). The distal esophagus (yellow arrow) is in normal position. The antrum of the stomach (thick blue arrow in panel A and B) has rotated 180 degrees in a cranial direction and the fundus is positioned&nbsp;caudally (white arrowhead A).&nbsp;The mesenteroaxial volvulus&nbsp;is&nbsp;shown on reformatted CT study. A follow-up barium swallow fluoroscopic examination shows normal anatomic positioning of the stomach after the patient underwent fundoplication and gastropexy (C).",
"    <div class=\"footnotes\">",
"     CT: Computed tomography",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Joseph Farnam, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
