var title_f11_3_11323="Skin testing protocol LA";
var content_f11_3_11323=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F80642&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F80642&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Skin testing protocol for patients with histories of possible IgE-mediated reactions to local anesthetics",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Step",
"      </td>",
"      <td class=\"subtitle1\">",
"       Route",
"      </td>",
"      <td class=\"subtitle1\">",
"       Volume, mL",
"      </td>",
"      <td class=\"subtitle1\">",
"       Dilution",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1",
"      </td>",
"      <td>",
"       Puncture",
"      </td>",
"      <td>",
"       _",
"      </td>",
"      <td>",
"       Undiluted&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2",
"      </td>",
"      <td>",
"       Intradermal",
"      </td>",
"      <td>",
"       0.02 cc",
"      </td>",
"      <td>",
"       1:100",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Prick (epicutaneous) testing is performed initially, with appropriate positive (histamine) and negative (diluent) controls. Results are assessed at 20 minutes. A positive result consists of a wheal 3 mm greater than the negative control. If prick tests are negative, then intradermal testing is performed by injecting 0.02 mL of a 1:100 dilution of the local anesthetic in question.",
"    <div class=\"footnotes\">",
"     &bull; The concentration of the local anesthetic (usually 1 to 2 percent) to be used for the procedure.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
