var title_f11_3_11324="Features spasmus nutans";
var content_f11_3_11324=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F76335&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F76335&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Features distinguishing spasmus nutans from congenital nystagmus",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Congenital nystagmus",
"       </td>",
"       <td class=\"subtitle1\">",
"        Spasmus nutans",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\" rowspan=\"1\">",
"        Features of nystagmus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Waveform",
"       </td>",
"       <td>",
"        Often mixed with jerk",
"       </td>",
"       <td>",
"        Strictly pendular",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Amplitude",
"       </td>",
"       <td>",
"        Large, always &gt;3&ordm;",
"       </td>",
"       <td>",
"        Small, often &lt;3&ordm;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Amplitude asymmetry",
"       </td>",
"       <td>",
"        Minimal (&lt;25 percent)",
"       </td>",
"       <td>",
"        &gt;25 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Frequency",
"       </td>",
"       <td>",
"        Slow, &lt;7Hz",
"       </td>",
"       <td>",
"        Fast, &gt;7Hz",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Phase relationship",
"       </td>",
"       <td>",
"        Conjugate",
"       </td>",
"       <td>",
"        Dysconjugate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Duration",
"       </td>",
"       <td>",
"        Constant",
"       </td>",
"       <td>",
"        Intermittent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\" rowspan=\"1\">",
"        Other features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age at onset",
"       </td>",
"       <td>",
"        &lt;6 months",
"       </td>",
"       <td>",
"        &gt;6 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Associated strabismus/amblyopia",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        More frequent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Head nodding",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Larger and more frequent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Horizontal OKR",
"       </td>",
"       <td>",
"        Absent or inverted",
"       </td>",
"       <td>",
"        Normal",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Gottlob, I, Zubcov, A, Catalano, RA, et al. Ophthalmology 1990; 97:1166.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
