var title_f11_3_11325="Desensitiz for chemo hypersens";
var content_f11_3_11325=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F77173%7EONC%2F61477&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F77173%7EONC%2F61477&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Premedication regimens",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Intravenous premedication regimen",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Premedications (last dose immediately prior to infusion of chemotherapy)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Dexamethasone, 10-20 mg iv every 6 hours for 4 doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Cimetidine, 300 mg iv every 8 hours for 3 doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Diphenhydramine hydrochloride, 25-50 mg iv every 6 hours for 4 doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Optional",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Ondansetron hydrochloride (Zofran), 8 mg iv every 6 hours for 4 doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Albuterol nebulizer, 2.5 mg every 6 hours for 4 doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Oral premedication regimen",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Premedications",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Dexamethasone, 20 mg po every 6 hours for 4 to 8 doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Cimetidine, 300-600 mg po every 8 hours for 3 to 6 doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Diphenhydramine hydrochloride, 25-50 mg every 6 hours for 4 to 8 doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Optional",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Albuterol multidose inhaler, two puffs administered every 6 hours for 8 doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Immediately prior to infusion of chemotherapy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Dexamethasone, 20 mg iv",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Cimetidine, 300-600 mg iv",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Diphenhydramine hydrochloride, 25-50 mg iv",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Optional",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Lorazepam, 0.5 mg iv",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Ondansetron hydrochloride, 8 mg iv",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       May continue dexamethasone, cimetidine, diphenhydramine during infusion",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     Note: Patients with delayed reactions may continue dexamethasone, 8 mg po every 12 hours for 5 days as outpatients.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Robinson, JB, Singh, D, Bodurka-Bevers, DC, et al. Hypersensitivity reactions and the utility of oral and intravenous desensitization in patients with gynecologic malignancies. Gynecologic Oncol 2001; 82:555. Copyright &copy; 2001 Elsevier Science.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Desensitization protocols",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Platinum administration",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Mix calculated total dose in 100 cc D5W.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Administer 0.1 cc of this solution in 100 cc D5W over 1 h (1:1000 dilution).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       If tolerated, administer 1 cc of the solution in 100 cc D5W over 1 h (1:100 dilution).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       If tolerated, administer 10 cc of the solution in 100 cc D5W over 1 h (1:10 dilution).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       If tolerated, administer the remaining solution over 1 h (1:1 dilution)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       OR: Administer at 25 percent of usual rate for 1 h.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       If tolerated, administer at 50 percent of the usual rate for 1 h.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       If tolerated, administer at 75 percent of the usual rate for 1 h.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       If tolerated, administer the remaining at usual rate.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Robinson, JB, Singh, D, Bodurka-Bevers, DC, et al. Hypersensitivity reactions and the utility of oral and intravenous desensitization in patients with gynecologic malignancies. Gynecologic Oncol 2001; 82:555. Copyright &copy;2001 Elsevier Science.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f11_3_11325=[""].join("\n");
